#!/usr/bin/env python

import unittest
from palin2 import nextPalindrome
from palin import isPalindrome

longnumber = '849014321431431434314438393920209394959502093999999999999999999999999999999999999999999999999999999999999999999999999999999999999994561123415645612343243423423412343'
longnumber2 = ''

longnumber3 = ''

class nextPalindromeTests(unittest.TestCase):
    
    def test1(self):
        self.assertEqual(nextPalindrome('909'), '919')
        
    def test2(self):
        self.assertEqual(nextPalindrome('185999582'), '186000681')
        
    def test3(self):
        self.assertEqual(nextPalindrome('999'), '1001')
        
    def test4(self):
        self.assertEqual(nextPalindrome('849014321431431434314438393920209394959502093'), '849014321431431434314444413434134134123410948')    
        
    def test5(self):
        self.assertEqual(nextPalindrome('185432'), '185581')

    def test6(self):
        p = nextPalindrome(longnumber)    
        self.assertTrue(isPalindrome(p))
        
    def test7(self):
        p = nextPalindrome(longnumber2)    
        self.assertTrue(isPalindrome(p))
        
    def test8(self):
        p = nextPalindrome(longnumber3)
        self.assertTrue(isPalindrome(p))
        
    def testLongRun(self):
        for n in range(0,1000):
            self.test4()
            
    def testReallyLongRun(self):
        for n in range(0,1000):
            self.test8()


if __name__ == '__main__':
    unittest.main()